//             </a>
//             <p className="pick-title">{p.title}</p>
//             <p className="pick-des">jjjj{p.meta}</p>
//         </div>
//     )
// })


const Picks =()=> {
    useEffect(()=>{
        fetch(`https://qoolqatar.com/qool_qatar/api/homedata`, {
            method: "GET" // default, so we can ignore
          })
    })
}

const TopPicks = () => {





    var settings = {
        dots: false,
        lazyLoad: 'progressive',
        infinite: true,
        speed: 500,
        autoplay: true,
        slidesToShow: 4,
        slidesToScroll: 1,
        responsive: [
			{
				breakpoint: 480,
				settings: {
					slidesToShow: 2,
					slidesToScroll: 1
				}
			}
		]
    };

    return (
        <section className="top-picks pick-box1">
            <Container>
                <Row>
                    <Col lg={6}>
                        <h3>Top Picks</h3>
                    </Col>
                    <Col lg={6}></Col>
                </Row>
                <Row className="bottom-line">
                    <Col lg={12}>
                        <Slider {...settings}>
                            {Picks}
                        </Slider>
                    </Col>
                </Row>
            </Container>
        </section>
    )
}

export default TopPicks;
